import React from 'react';
import PatientItem from './PatientItem';
import './PatientList.css';

const PatientList = ({ searchTerm, searchBy }) => {
  const patients = [
    { name: '정재욱', id: '#XOEIF5GJ' },
    { name: '여은동', id: '#EXFQ921K' },
    { name: '현뚱따', id: '#MAPLEII16' },
    { name: '정진우', id: '#DARKYETI'  }
  ];

  const filteredPatients = patients.filter((patient) => {
    if (searchBy === 'name') {
      return patient.name.includes(searchTerm);
    } else if (searchBy === 'id') {
      return patient.id.includes(searchTerm);
    }
    return false;
  });

  return (
    <div className="patient-list">
      {filteredPatients.map((patient, index) => (
        <PatientItem key={index} patient={patient} />
      ))}
    </div>
  );
};

export default PatientList;
